INSERT INTO `usb-c-ethernet-adapter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (1, '../img/products/USB-C-Ethernet-Adapter/CSL - USB C Netzwerkadapter.webp;', 'CSL - USB C Netzwerkadapter', 'https://www.amazon.de/CSL-Netzwerkadapter-Netzwerkkarte-Konverter-kompatibel/dp/B08N6YB69C/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=27OCQB38AXDZY&keywords=CSL+-+USB+C+Netzwerkadapter&qid=1667508345&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=csl+-+usb+c+netzwerkadapter%2Caps%2C120&sr=8-3', '12,99', 4.6, 90, 3, 'black;CSL-Computer;32 g;-;1000 Megabits Per Second;USB, Ethernet, USB 3.2 Gen 1, USB-C;Laptop, Tablet;Notebooks sind leistungsfähige Rechner, und auch Smartphones bieten eine beeindruckende Performance. Warum dann die Limitierungen durch WLAN in Kauf nehmen? Gehen Sie zuhause auf volle Leistung! Der USB-C auf Ethernet-Adapter liefert Ihnen stabile Verbindungsgeschwindigkeiten von bis zu 1 Gbit/s. Flüssiges Serien-Streamen und große Downloads frei von Unterbrechungen! | 304667|Schnittstellen: USB 3.2 Gen. 1 Typ C Stecker zu 1x RJ45-Buchse (10/100/1000 Mbit) | unterstützt IEEE 802.3, IEEE 802.3u, IEEE 802.3ab und IEEE | Crossover-Erkennung | Auto-Korrektur (Auto MDIX) | Halbduplex / Vollduplex-Modus in Fast Ethernet | abwärtskompatibel zu USB 2.0 und 1.1 | Plug and Play | LED-Funktionsanzeige (grün/orange/weiß) | Automatische Geschwindigkeitserkennung.|Unterstützt alle USB 3.2 Stromsparmodi (U0, U1, U2 und U3) | LAN-Geschwindigkeit max. 1000 Mbit/s | Stromversorgung über USB, kein Netzteil erforderlich | Chipsatz: RTL8153 | Kompatibel mit Mac OS 10.6 und höher, Windows 7-11.|Der geflochtene Stoffmantel bietet erhöhten Schutz für die Kabelisolierung. Mit Premium-Aluminiumgehäuse für eine bessere Wärmedämmung.|Kompatibel mit USB-C-Geräten wie (Beispiele!) MacBook Pro 2020/2019/2018/2017, MacBook Air 2020/2019/2018, iPad Pro 2020/2018, Dell XPS 13/15, MS Surface Book 2 / 3, Google Chromebook Pixel, Asus ZenBook, Lenovo Yoga 720/910/920, Vivobook, Samsung S8/S9/S10 / Note 8/Note 9/Note 10, Samsung Tab A 10.5, Tab SM-T950, Google Pixel / Pixel 2 und viele andere USB-C-Laptops, Tablets und Smartphones');
