INSERT INTO `usb-c-ethernet-adapter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (10, '../img/products/USB-C-Ethernet-Adapter/Syncwire USB-C Ethernet Adapter.webp;', 'Syncwire USB-C Ethernet Adapter', 'https://www.amazon.de/Syncwire-USB-Gigabit-Ethernet-Adapter/dp/B074C76S4H/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3DOJD706PUF5A&keywords=Syncwire+USB-C+Ethernet+Adapter&qid=1667508415&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C103&sr=8-3', '15,99', 4.5, 686, 0, 'black;Syncwire;30 g;Windows 10/XP/7/8/8.1/, Mac OS und Chrome, wie MacBook Pro, MacBook;1000 Megabits Per Second;Ethernet;<span class="a-truncate" data-a-word-break="normal" data-a-max-rows="3" data-a-overflow-marker="&amp;hellip;" style="line-height: 1.3em !important; max-height: 3.9em;" data-a-recalculate="false" data-a-updated="true"><span class="a-truncate-full a-offscreen">MacBook, MacBook Air/Pro, iMac/iMac Pro, Surface Go/Book 2, Chromebook, Pixelbook, Samsung S8/S8 Plus/Note 8/Note 9 usw, Asus ZenBook/VivoBook, Dell XPS 13/15, Dell Inspiron/Alienware, Lenovo ThinkPad/Yoga, iPad Pro</span><span class="a-truncate-cut" aria-hidden="true" style="height: 3.9em;">MacBook, MacBook Air/Pro, iMac/iMac Pro, Surface Go/Book 2, Chromebook, Pixelbook, Sa…</span></span>;[Universelle Kompatibilität] - Geeignet für die Laptops, Tablets und Smartphones mit USB-C Ports wie MacBook, MacBook Air/Pro, iMac/iMac Pro, Surface Go/Book 2, Chromebook, Pixelbook, Asus ZenBook/VivoBook, Dell XPS 13/15, Dell Inspiron/Alienware, Lenovo ThinkPad/Yoga, iPad Pro, Samsung S8/S8 Plus/Note 8/Note 9 und andere USB-Typ-C-Geräte.|[Stabile und schnelle Verbindung] - Der Syncwire USB C Ethernet Adapter mit Hochgeschwindigkeits-USB 3.1. Erhalten Sie stabile Verbindungsgeschwindigkeiten von bis zu 1 Gbit/s. Mit ihm können Sie nun Daten mit einer zehnfachen Geschwindigkeit gegenüber dem älteren USB 2.0/1.1 übertragen. Es ist auch rückwärts kompatibel zu 10M/100Mbps-Netzwerken.|[Einfach zu nutzen] - Der USB-C RJ45 Adapter benötigt keine Software, Treiber oder einen komplizierten Installationsprozess. Er funktioniert unter Windows 10/XP/7/8/8.1, Mac OS 10.8 und höher, Chrome und Linux.|[Unibody-Design] - Das kompakte Aluminium Design und Unibody-Design, automatisierte Schweißtechnologie, reißfestes und hochelastisches TPE-Material, um die Leistungsfähigkeit und Haltbarkeit des Produktes sicherzustellen. Der Adapter wiegt dabei nur 37g.|[Exzellenter Kundendienst] - Freundliche Gewährleistungsbetreuung ohne zusätzliche Kosten. Schneller und einfach erreichbarer Kundendienst, um Ihre Probleme innerhalb von 24 Stunden zu lösen.');
